import { Component } from "@angular/core";
@Component({
  selector: 'app-navbar',
  templateUrl: './app-navbar.html'
})
export class NavBar {
  isCollapsed = true;
}
<nav class="navbar navbar-expand-lg bg-body-tertiary" style="background-color: #444444 !important;">
  <div class="container-fluid">
    <a class="navbar-brand text-white" href="#" >ProEventos</a>
    <button (click)="isCollapsed = !isCollapsed" [attr.aria-expanded]="!isCollapsed" class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNavAltMarkup" [collapse]="isCollapsed" [isAnimated]="true" >
      <div class="navbar-nav">
        <a class="nav-link active text-white" aria-current="page" href="#">Eventos</a>
        <a class="nav-link text-white" href="#">Palestrantes</a>
        <a class="nav-link" href="#">Contatos</a>
      </div>
    </div>
  </div>
</nav>
